import React from "react";
import { Button, Card, Elevation } from "@blueprintjs/core";

const CarCard= () => {
    return (
        <div>
        <Card className="cars-card" interactive={true}>
            <h5>
            <a href="#">IBM_1</a>
            </h5>
            <p>Card content</p>
            <Button>Submit</Button>
        </Card>
        </div>
    );
}

export default CarCard;
